import React, { useEffect, useState } from "react";
import axios from "axios";
import DashboardLayout from "../components/DashboardLayout";

export default function AdminDashboard() {
  // State variables
  const [schools, setSchools] = useState([]);
  const [players, setPlayers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");
  const [view, setView] = useState("schools");

  const token = localStorage.getItem("token");

  // Fetch schools and players data
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setErr("");
      try {
        const [schoolsRes, playersRes] = await Promise.all([
          axios.get("http://localhost:5000/api/schools", {
            headers: { Authorization: `Bearer ${token}` },
          }),
          axios.get("http://localhost:5000/api/players", {
            headers: { Authorization: `Bearer ${token}` },
          }),
        ]);

        setSchools(schoolsRes.data.schools || []);
        setPlayers(playersRes.data.players || []);
      } catch (error) {
        setErr(error?.response?.data?.message || "Error loading data.");
      }
      setLoading(false);
    };

    fetchData();
  }, [token]);

  // Render loading state or actual data
  return (
    <DashboardLayout>
      <div className="flex flex-col gap-6 w-full">
        <h1 className="text-3xl font-extrabold text-athletiq-navy mb-2">
          Admin Dashboard
        </h1>
        {err && <div className="text-red-500 mb-4">{err}</div>}
        {loading ? (
          <div>Loading...</div>
        ) : (
          <>
            {/* Schools View */}
            {view === "schools" && (
              <div>
                <h2 className="text-xl font-bold text-athletiq-navy">
                  All Schools
                </h2>
                <table className="min-w-full text-sm">
                  <thead>
                    <tr className="bg-athletiq-blue text-white">
                      <th className="p-2 text-left">Name</th>
                      <th className="p-2 text-left">Address</th>
                      <th className="p-2 text-left">Email</th>
                    </tr>
                  </thead>
                  <tbody>
                    {schools.map((school) => (
                      <tr key={school.id} className="border-b last:border-none">
                        <td className="p-2">{school.name}</td>
                        <td className="p-2">{school.address}</td>
                        <td className="p-2">{school.email}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}

            {/* Players View */}
            {view === "players" && (
              <div>
                <h2 className="text-xl font-bold text-athletiq-navy">
                  All Players
                </h2>
                <table className="min-w-full text-sm">
                  <thead>
                    <tr className="bg-athletiq-blue text-white">
                      <th className="p-2 text-left">Name</th>
                      <th className="p-2 text-left">School</th>
                      <th className="p-2 text-left">DOB</th>
                    </tr>
                  </thead>
                  <tbody>
                    {players.map((player) => (
                      <tr key={player.id} className="border-b last:border-none">
                        <td className="p-2">{player.full_name}</td>
                        <td className="p-2">{player.school_name}</td>
                        <td className="p-2">{player.dob}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </>
        )}
      </div>
    </DashboardLayout>
  );
}
